import React, { Component } from 'react';

class App extends React.Component {
   constructor(props) {
      super(props);
      this.state = {
         posts: [],
         isShareModalOpen: false,
         shareTitle: '',
         shareOrigin: '',
         shareURL: '',
         cardExpanded: false,
         cardIdentifierentifier: '',
         expandedCardContent: {},
         searchQuery: ''
      };
      this.props = {
         currentPage: '',
         searchQuery: '',
         currentOrigin: '',
      }

   }

   render() {
      return (
         <>
            <p>
               <strong>Location Props: </strong>
               {JSON.stringify(this.props.location, null, 2)}
            </p>
            <p>
               <strong>Query Param: </strong>
               {this.props.search}
            </p>
         </>
      );
   }
}

export default SearchPage;
